Vue.component('app-media-gallery', {
    template: '#vue-app-media-gallery',
    props: ['patternBgColor', 'tabs'],
    data: function () {
        return {
            tab: 'upload',
            query: '',
            uploading: false,
            image_max_width: 1920,
            tab_enabled: ['search','upload','patterns','gradients'],
            options: {},
            results: [],
            gradients_base_url: '/img/backgrounds/gradients/',
            gradients: [
                'gradient_001.jpg',
                'gradient_002.jpg',
                'gradient_003.jpg',
                'gradient_004.jpg',
                'gradient_005.jpg',
                'gradient_006.jpg',
                'gradient_007.jpg',
                'gradient_008.jpg',
                'gradient_009.jpg',
                'gradient_010.jpg',
                'gradient_011.jpg',
                'gradient_012.jpg',
                'gradient_013.jpg',
                'gradient_014.jpg',
                'gradient_015.jpg',
                'gradient_016.jpg',
                'gradient_017.jpg',
                'gradient_018.jpg',
                'gradient_019.jpg',
                'gradient_020.jpg',
                'gradient_021.jpg',
                'gradient_022.webp',
                'gradient_premium_001.jpg',
                'gradient_premium_002.jpg',
                'gradient_premium_003.jpg',
                'gradient_premium_004.jpg',
                'gradient_premium_005.jpg',
                'gradient_premium_006.jpg',
                'gradient_premium_007.jpg',
            ],
            patterns_base_url: '/img/backgrounds/patterns/',
            patterns: [
                'triangles-and-diamonds.png',
                'subtle-zebra-3d.png',
                'simple-dashed.png',
                'silver-scales.png',
                'old-mathematics.png',
                'nami.png',
                'my-little-plaid-dark.png',
                'bg-hearts-small.png',
                'green-gobbler.png',
                'escheresque-dark.png',
                'dark-wood.png',
                'crisp-paper-ruffles.png',
                'connected.png',
                'cartographer.png',
                'candyhole.png',
                'black-thread-light.png',
                // '_sun-rays-top-left.png'
            ]
        }
    },

    mounted: function() {
        var _this = this;
        this.$form = $('form#signupForm');
        $('#mediaGalleryModal').on('hidden.bs.modal', function (e) {
            _this.onClose();
        });
    },

    methods: {
        open: function (options) {
            this.options = options || {};
            $('#mediaGalleryModal').modal();

            // restore default
            this.tab_enabled = ['search','upload','patterns','gradients'];
            this.query = '';
            this.tab = 'upload';
            this.image_max_width = 1920;

            if (this.options.query) {
                this.tab = 'search';
                this.query = this.options.query;
                this.onSearch();
            }

            if (this.options.tabs) {
                this.tab_enabled = this.options.tabs.split(',');
            }

            if (this.options.image_max_width) {
                this.image_max_width = parseInt(this.options.image_max_width);
            }
        },

        close: function () {
            $('#mediaGalleryModal').modal('hide');
        },

        onClose: function () {
            this.$emit('closed', this.options);
        },

        onImageSelected: function (event) {
            console.log(event);
            var _this = this;
            // this.uploadImage();
            // var file_data = event[0];
            // var form_data = new FormData();
            // form_data.append("file", file_data);

            // this.uploading = true;

            if (event.length) {
                var reader = new FileReader();
                reader.onload = function (e) {
                    _this.onImageUploaded({
                        data: {url: e.target.result}
                    })
                    // _this.template.profile_image = e.target.result;
                    // mixpanel.track("AS_WheelUserAction", {'action': 'Uploaded_Logo'});

                    // _this.resizeDownDataUrlKeepProportions(e.target.result, 300, 300, function (data) {
                    //     _this.template.profile_image = data;
                    // });
                }
                // reader.onerror = e => rej(e);
                reader.readAsDataURL(event[0]);
            }

            return false;

            $.ajax({
                url: "/api/images",
                type: 'POST',
                cache: false,
                contentType: false,
                dataType: 'json',
                processData: false,
                data: form_data,
                success: this.onImageUploaded
            });
        },

        onImageUploaded: function (response) {
            var data = response.data;
            data.options = this.options;
            this.uploading = false;
            this.$emit('upload', data);
            this.close();
        },


        onPatternSelected: function (image) {
            var data = {
                url: this.patterns_base_url + image,
                options: this.options
            };
            this.$emit('selected', data);
            this.close();
        },

        onGradientSelected: function (image) {
            var data = {
                url: this.gradients_base_url + image,
                options: this.options
            };
            this.$emit('selected', data);
            this.close();
        },

        onSearch: function () {
            this.uploading = true;
            var q = this.query;

            if (!q) {
                q = 'social+media';
            }

            $.ajax({
                url: "https://api.unsplash.com/search/photos?page=1&client_id=kkMkKNh0WZ0i8ZBmplWy3yHSJc3ZCMrg_I-FDC_EOFI&per_page=30&query=" + q,
                type: 'GET',
                success: this.onSearchDone
            });
        },

        onSearchDone: function (response) {
            this.uploading = false;
            this.results = response.results;
        },

        downloadImage: function (image) {
            this.uploading = true;
            $.ajax({
                url: image.links.download_location + '?client_id=kkMkKNh0WZ0i8ZBmplWy3yHSJc3ZCMrg_I-FDC_EOFI',
                type: 'GET',
                success: this.onImageDownloaded
            });
        },

        onImageDownloaded: function (response) {

            if (this.image_max_width) {
                response.url += '&w=' + this.image_max_width;
            }

            var form_data = new FormData();
            form_data.append("url", response.url);

            $.ajax({
                url: "/api/images",
                type: 'POST',
                cache: false,
                contentType: false,
                processData: false,
                dataType: 'json',
                data: form_data,
                success: this.onImageUploaded
            });
        },

    }
});

Vue.component('app-file-uploader', {
    template: '#vue-app-file-uploader',
    props: ['maxSize', 'type', 'accept', 'extensions'],
    // props: {
    //     maxSize: {
    //         type: Number,
    //         default: 0
    //     },
    //     accept: {
    //         type: String,
    //         default: '.csv, .txt, text/csv, text/plain'
    //     },
    //     accept: {
    //         type: String,
    //         default: '.csv, .txt, text/csv, text/plain'
    //     },
    // },

    data: function () {
        return {
            dragging: false
        }
    },

    mounted: function() {
        var _this = this;
        this.$form = $('form#signupForm');
    },

    methods: {
        onDrop: function (e) {
            // console.log(e);
            this.dragging = false;
            this.onFileSelected(e)
        },
        onClick: function (e) {
            this.$refs["input"].click();
        },
        checkDrop: function (e) {
            // console.log(e);
            e.preventDefault();
        },
        onFileSelected: function (event) {
            console.log(event);
            var files = (event.dataTransfer) ? event.dataTransfer.files : event.target.files;
            var valid = true;

            if (this.maxSize) {
                for (i=0; i<files.length; i++) {
                    if (files[i].size > (this.maxSize*1024*1024)) {
                        valid = false;
                    }
                }
            }

            if (valid) {
                this.$emit('done', files);
            } else {
                this.$refs.input.value = "";
                alert('max file is: ' + this.maxSize + 'MB')
            }
        },

    }
});

Vue.component('app-signup', {
    template: '#vue-app-signup',
    props: ['source', 'socialLoginOnly'],
    data: function () {
        return {
            loading: false,
            accountCreated: false,
            connecting_with_facebook: false,
            connecting_with_google: false,
            tab: 'signup',
            form: {
                // full_name: '',
                first_name: '',
                last_name: '',
                email: '',
                password: '',
                lang: 'es',
                source: '',
            },
            errors: {
                full_name: false,
                first_name: false,
                last_name: false,
                email: false,
                password: false,
            },
            email_exists: false,
            email_verification_fail: false,
            $form: null,
            pwd_visible: false,
            is_email_pwd_form_active: true,
        }
    },

    mounted: function() {
        this.$form = $('form#signupForm');

        if (window.locale) {
            this.form.lang = window.locale;
        }

        if (this.source) {
            this.form.source = this.source;
        }

        if (this.socialLoginOnly) {
            this.is_email_pwd_form_active = false;
        }
    },

    computed: {
        valid: function () {
            var valid = true;
            var _this = this;

            Object.keys(this.errors).forEach(function (key) {
                if (_this.errors[key] === true) {
                    valid = false;
                }
            });

            return valid;
        }
    },

    methods: {
        show: function () {
            $('#authModal').modal();
            this.accountCreated = false;
            this.onFocusOnInput('signup_name_input');
        },
        hide: function () {
            $('#authModal').modal('hide');
        },

        signup: function () {
            this._validate();

            if (this.valid) {
                this.pwd_visible = false;
                return this.submit();
            }

            this.$form[0].reportValidity();
            return false;
        },

        login: function () {
            this._validate();

            if (this.valid) {
                this.pwd_visible = false;
                return this.submitLogin();
            }

            this.$form[0].reportValidity();
            return false;
        },

        submit: function () {
            // var ajaxurl = this.$form.attr("action");
            // var data = this.$form.serialize();
            this.loading = true;
            $.post('/signup', this.form, this.onSignup, 'json');
        },

        submitLogin: function () {
            this.loading = true;
            var data = {
                email: this.form.email,
                password: this.form.password
            };
            $.post('/api/login', data, this.onLogin, 'json');
        },

        onSignup: function (response) {
            this.loading = false;

            if (response.success && response.user) {
                this.$emit('signup', {
                    user: response.user
                });
                this.accountCreated = true;
            }
            if (response.error) {
                if (response.error === 'EMAIL_TAKEN') {
                    this.errors.email = true;
                    this.email_exists = true;
                }
                if (response.error === 'EMAIL_VERIFICATION_FAIL') {
                    this.errors.email = true;
                    this.email_verification_fail = true;
                }
            }
        },

        onLogin: function (response) {
            this.loading = false;

            if (response.success && response.data) {
                this.$emit('login', {
                    user: response.data
                });
            }
            if (response.error) {
                if (response.error === 'INVALID_CREDENTIALS') {
                    this.errors.email = false;
                    this.errors.password = true;
                }
                if (response.error === 'INVALID_EMAIL') {
                    this.errors.email = true;
                    this.errors.password = false;
                }
            }
        },

        _validate: function(e) {
            var f = this.form;
            var e = this.errors;

            // e.first_name = (f.first_name.length < 2);
            // var names = f.full_name ? f.full_name.split(' ') : [];

            // e.full_name = (names.length < 2 && this.tab === 'signup');
            if (this.tab === 'signup') {
                e.first_name = (f.first_name.length < 2);
                e.last_name = (f.last_name.length < 2);
            }
            e.email = !this._validateEmail(f.email);
            e.password = (f.password.length < 6);

            // return Object.values(e).filter(function (val) { return !val } );
        },

        _validateEmail: function (email) {
            if (email.indexOf('+') > -1) {
                // return false;
            }
            var re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
            return re.test(String(email).toLowerCase());
        },

        cleanError: function (input) {
            this.errors[input] = false;
        },

        onSwitchTab: function (tab) {
            this.tab = tab;
            this.form.email = '';
            this.form.password = '';
            this.errors = {
                full_name: false,
                email: false,
                password: false,
            };

            if (tab === 'signup') { this.onFocusOnInput('signup_name_input'); }
            if (tab === 'signin') { this.onFocusOnInput('signin_email_input'); }
        },

        onContinue: function () {
            this.$emit('close', true);
        },

        onFocusOnInput: function (input_ref, delay) {
            var _this = this;
            var _d = delay || 50;
            setTimeout(function () {
                _this.$refs[input_ref].focus()
            }, _d);
        },

        onFacebookLogin: function () {
            var query_str = '?locale=' + window.locale;

            if (this.source) {
                query_str += '&source=' + this.source;
            }

            this.connecting_with_facebook = true;
            window.facebook_login_window = window.open('/auth/facebook' + query_str);
            setTimeout(this.facebookSignInCallback, 500);
        },

        facebookSignInCallback: function () {
            let _this = this;

            setTimeout(() => {
                if (window.facebook_login_window && window.facebook_login_window.closed) {
                    window.facebook_login_window = null;
                    _this.connecting_with_facebook = false;
                    return false;
                }
                try {
                    // console.log(window.facebook_login_window.location.href);
                    if (window.facebook_login_window && window.facebook_login_window.location && window.facebook_login_window.location.href.indexOf('app-sorteos') !== -1) {
                        window.facebook_login_window.close();
                        $.getJSON('/api/user/me', function (response) {
                            console.log(response);
                            _this.$emit('login', {
                                user: response.data
                            });
                            _this.connecting_with_facebook = false;
                        })
                    } else {
                        _this.facebookSignInCallback();
                    }
                } catch (err) {
                    _this.facebookSignInCallback();
                }
            }, 200);
        },

        onGoogleLogin: function () {
            var query_str = '?locale=' + window.locale;

            if (this.source) {
                query_str += '&source=' + this.source;
            }

            this.connecting_with_google = true;
            window.facebook_login_window = window.open('/auth/google' + query_str);
            setTimeout(this.googleSignInCallback, 500);
        },

        googleSignInCallback: function () {
            let _this = this;

            setTimeout(() => {
                if (window.facebook_login_window && window.facebook_login_window.closed) {
                    window.facebook_login_window = null;
                    _this.connecting_with_facebook = false;
                    return false;
                }
                try {
                    // console.log(window.facebook_login_window.location.href);
                    if (window.facebook_login_window && window.facebook_login_window.location && window.facebook_login_window.location.href.indexOf('app-sorteos') !== -1) {
                        window.facebook_login_window.close();
                        $.getJSON('/api/user/me', function (response) {
                            console.log(response);
                            _this.$emit('login', {
                                user: response.data
                            });
                            _this.connecting_with_facebook = false;
                        })
                    } else {
                        _this.googleSignInCallback();
                    }
                } catch (err) {
                    _this.googleSignInCallback();
                }
            }, 200);
        },

        onShowAuthForm: function () {
            this.is_email_pwd_form_active = true;
        },
    }
});

